package com.poonam.doit.di.moduleimport androidx.lifecycle.ViewModelimport androidx.lifecycle.ViewModelProviderimport com.poonam.doit.MainViewModelimport com.poonam.doit.di.factory.ViewModelFactoryimport com.poonam.doit.di.key.ViewModelKeyimport dagger.Bindsimport dagger.Moduleimport dagger.multibindings.IntoMap@Moduleabstract class ViewModelModule {    @Binds    abstract fun bindViewModelFactory(factory: ViewModelFactory) : ViewModelProvider.Factory    @Binds    @IntoMap    @ViewModelKey(MainViewModel::class)    protected abstract fun mainViewModel(mainViewModel: MainViewModel) : ViewModel}